&quot;Pour It Up&quot; is a song by Barbadian recording artist Rihanna from her seventh studio album Unapologetic (2012). It was serviced to urban radio stations in the United States on January 8, 2013, as the second US single, and third overall single from the album. It was later also sent to contemporary hit radio radios in the country. &quot;Pour It Up&quot; was co-written and produced by Michael Williams and co-produced by J-Bo. It is a club song with a minimal hip hop beat. Lyrically, Rihanna brags about her wealth on the song, which serves as both a strip club anthem and a declaration of independence.The official music video for &quot;Pour It Up&quot; was filmed in May 2013.In September 2013, the director Vincent Haycock, tweeted that he was no longer involved with the project due to Ã¢â‚¬Å“creative differencesÃ¢â‚¬ï¿½, Rihanna later replied to him by stating: Ã¢â‚¬Å“Just take your name off the check while u at it! Whatever your issue is leave my fans out of it&quot;. That same month, Rihanna posted new behind the scenes pictures from the shoot and stated that the video will be released in October 2013.It was later uploaded on Rihanna's official VEVO account.

